import React from 'react';
import './LoginPage.css';
import {Container, TextField} from "@material-ui/core";

function LoginPage() {
	return (
		<Container>
			<div className="login-form">
				<form>
					<TextField 
						id="email" 
						label="E-Mail" 
						className="form-input"
						inputProps = {{style: {color: 'white'}}}></TextField>
				</form>
			</div>
		</Container>
	)
}

export default LoginPage;
